import SearchBar from '../src/components/searchbar'
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import './index.css';



export default class App extends Component {
    render() {
        return (
            <div>
                   <span style={{border: "solid 10px yellow", width: "100%",height: "100px"}}>

                    <MapContainer/>
                    <br/>
                    </span>

                    <div style={{border: "solid 10px red", width: "100%",height: "100px", marginTop:"10%" }} >

                    <MuiThemeProvider>
                    <SearchBar/>
                    </MuiThemeProvider>
                    </div>


            </div>
        )
    }
}
